import styled from 'styled-components';



const TopCompo = () => {
    return(
        <div>
            <div>
                <Top>
                    <div>
                        <span>BAR11 석구실장 010 2073 9779</span>
                        <span>강남착석바 BAR 11</span>
                        <span>강남유일의, 최대 규모의 클럽형 착석바입니다.</span>
                    </div>
                </Top>
            </div>
        </div>
    );
}

export default TopCompo;

const Top = styled.div`

`;
